// Funciones en JS
const saludar = function (nombre){
    return `Hola, ${nombre}`;
}

const saludar2 = (nombre) =>{
    return `Hola, ${nombre}`;
}


console.log(saludar('Pablo'))
console.log(saludar2('Pablo'))
